import React, { useState } from 'react';
import axios from 'axios';

function highlightMatch(context, match) {
  if (!match) return context;
  const idx = context.toLowerCase().indexOf(match.toLowerCase());
  if (idx === -1) return context;
  return (
    <>
      {context.slice(0, idx)}
      <span style={{ background: '#ffe066', fontWeight: 'bold' }}>{context.slice(idx, idx + match.length)}</span>
      {context.slice(idx + match.length)}
    </>
  );
}

function RegexTestModal({ open, onClose, context, defaultPattern, serverUrl }) {
  const [pattern, setPattern] = useState(defaultPattern || '');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleTest = async () => {
    setLoading(true);
    setResult(null);
    try {
      const controller = new AbortController();
      const timeoutId = setTimeout(() => controller.abort(), 10000); // 10 second timeout

      const resp = await fetch(`${serverUrl}/pattern-learning/test-regex`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ pattern, text: context, context_chars: 50 }),
        signal: controller.signal
      });

      clearTimeout(timeoutId);
      const data = await resp.json();
      setResult(data);
    } catch (e) {
      if (e.name === 'AbortError') {
        setResult({ matches: [], contexts: ['Error: Request timed out after 10 seconds'] });
      } else {
        setResult({ matches: [], contexts: ['Error: ' + e.message] });
      }
    }
    setLoading(false);
  };

  if (!open) return null;
  return (
    <div style={{ position: 'fixed', top: 0, left: 0, width: '100vw', height: '100vh', background: '#0008', zIndex: 1000, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      <div style={{ background: '#fff', padding: 32, borderRadius: 12, minWidth: 400, maxWidth: 600 }}>
        <h3>Live Regex Tester</h3>
        <div style={{ marginBottom: 12 }}>
          <label>Regex Pattern:</label>
          <input value={pattern} onChange={e => setPattern(e.target.value)} style={{ width: '100%', fontFamily: 'monospace', fontSize: 16, marginTop: 4 }} />
        </div>
        <button onClick={handleTest} style={{ marginBottom: 16, background: '#6c47ff', color: '#fff', border: 'none', borderRadius: 6, padding: '8px 20px', fontWeight: 'bold', cursor: 'pointer' }} disabled={loading}>
          {loading ? 'Testing...' : 'Test Regex'}
        </button>
        {result && (
          <div>
            <div style={{ marginBottom: 8 }}><b>Matches:</b> {result.matches && result.matches.length > 0 ? result.matches.join(', ') : 'None'}</div>
            <div style={{ marginBottom: 8 }}><b>Context:</b></div>
            {result.contexts && result.contexts.map((ctx, i) => (
              <div key={i} style={{ background: '#f6f6f6', padding: 8, marginBottom: 4, borderRadius: 4 }}>
                {result.matches && result.matches[i] ? highlightMatch(ctx, result.matches[i]) : ctx}
              </div>
            ))}
          </div>
        )}
        <button onClick={onClose} style={{ marginTop: 16, background: '#eee', color: '#333', border: 'none', borderRadius: 6, padding: '8px 20px', fontWeight: 'bold', cursor: 'pointer' }}>Close</button>
      </div>
    </div>
  );
}

const PatternLearningFeedback = ({ serverUrl, caseId = "54820" }) => {
  const [feedback, setFeedback] = useState({ extractionId: '', isCorrect: true, comments: '' });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const [enhancedAnalysis, setEnhancedAnalysis] = useState(null);
  const [regexModal, setRegexModal] = useState({ open: false, context: '', pattern: '' });
  const [error, setError] = useState(null);

  const fetchEnhancedAnalysis = async () => {
    setLoading(true);
    setError(null);
    try {
      const resp = await fetch(`${serverUrl}/enhanced-analysis/wi/${caseId}`);
      const data = await resp.json();
      if (data.success) {
        setEnhancedAnalysis(data.data);
      } else {
        setError(data.message || 'Failed to fetch analysis');
      }
    } catch (e) {
      setError(e.message);
    }
    setLoading(false);
  };

  const handleFeedback = async (extractionId, isCorrect) => {
    setFeedback(f => ({ ...f, extractionId, isCorrect }));

    try {
      const resp = await fetch(`${serverUrl}/pattern-learning/feedback`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          extraction_id: extractionId,
          is_correct: isCorrect,
          correct_value: null,
          comments: null
        })
      });

      if (resp.ok) {
        setMessage(`Feedback recorded: ${isCorrect ? 'Correct' : 'Incorrect'}`);
      } else {
        setMessage('Error recording feedback');
      }
    } catch (e) {
      setMessage('Error recording feedback: ' + e.message);
    }
  };

  const handleFormTypeFeedback = async (extractionId, correctFormType) => {
    try {
      const resp = await fetch(`${serverUrl}/pattern-learning/feedback`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          extraction_id: extractionId,
          is_correct: false,
          correct_value: correctFormType,
          comments: `Form type should be ${correctFormType}`
        })
      });

      if (resp.ok) {
        setMessage(`Form type feedback recorded: should be ${correctFormType}`);
      } else {
        setMessage('Error recording form type feedback');
      }
    } catch (e) {
      setMessage('Error recording form type feedback: ' + e.message);
    }
  };

  const getConfidenceColor = (confidence) => {
    if (confidence >= 0.8) return '#4caf50'; // Green
    if (confidence >= 0.6) return '#ff9800'; // Orange
    return '#f44336'; // Red
  };

  const getConfidenceBackground = (confidence) => {
    if (confidence < 0.7) return '#fff3cd'; // Light yellow warning
    return 'transparent';
  };

  const getWarningIcon = (extraction) => {
    const warnings = [];

    // Low confidence warning
    if (extraction.field_confidence < 0.7) {
      warnings.push('âš ï¸ Low confidence');
    }

    // False positive warning
    if (extraction.pattern_stats?.false_positive_rate > 0.3) {
      warnings.push('ðŸš¨ High false positive rate');
    }

    // Zero value warning
    if (extraction.extracted_value === '$0.00' || extraction.extracted_value === '0.00') {
      warnings.push('ðŸ’° Zero value detected');
    }

    return warnings;
  };

  return (
    <div className="pattern-learning-dashboard">
      <h2>ðŸ§  WI Pattern Learning Dashboard</h2>
      <p className="case-info">Case ID: {caseId}</p>
      {message && (
        <div className={`message ${message.includes('Error') ? 'error' : 'success'}`}>{message}</div>
      )}
      <div className="dashboard-grid">
        <div className="panel analysis-panel">
          <h3>ðŸ” Enhanced WI Analysis</h3>
          <button onClick={fetchEnhancedAnalysis} style={{ background: '#6c47ff', color: '#fff', border: 'none', borderRadius: 6, padding: '10px 32px', fontWeight: 'bold', cursor: 'pointer', marginBottom: 20 }}>
            Run Analysis
          </button>
          {loading && <div>Loading enhanced analysis...</div>}
          {error && <div style={{ color: 'red' }}>{error}</div>}
          {!enhancedAnalysis && !loading && (
            <div style={{ textAlign: 'center', padding: 40, color: '#666' }}>
              Click "Run Analysis" to start processing the WI transcript data.
            </div>
          )}
          {enhancedAnalysis ? (
            <div className="analysis-content">
              <div className="analysis-summary">
                <h4>Analysis Summary</h4>
                <div className="summary-item">
                  <span>Files Processed:</span>
                  <span>{enhancedAnalysis.files_processed || 0}</span>
                </div>
                <div className="summary-item">
                  <span>Files Successful:</span>
                  <span>{enhancedAnalysis.files_successful || 0}</span>
                </div>
                <div className="summary-item">
                  <span>Overall Confidence:</span>
                  <span className="confidence-score">
                    {(enhancedAnalysis.overall_confidence * 100).toFixed(1)}%
                  </span>
                </div>
                <div className="summary-item">
                  <span>Total Extractions:</span>
                  <span>{enhancedAnalysis.total_extractions || 0}</span>
                </div>
              </div>
              {enhancedAnalysis.all_extractions && enhancedAnalysis.all_extractions.length > 0 && (
                <div className="extractions-list">
                  <h4>Extraction Results</h4>
                  <table style={{ width: '100%', borderCollapse: 'collapse', marginBottom: 24 }}>
                    <thead>
                      <tr style={{ background: '#f6f6f6' }}>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Form Type</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Field Name</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Extracted Value</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Confidence</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Pattern</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Context</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Feedback</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Actions</th>
                      </tr>
                    </thead>
                    <tbody>
                      {enhancedAnalysis.all_extractions.map((ex, i) => {
                        const warnings = getWarningIcon(ex);
                        const rowStyle = {
                          backgroundColor: getConfidenceBackground(ex.field_confidence),
                          border: warnings.length > 0 ? '2px solid #ffc107' : '1px solid #eee'
                        };

                        return (
                          <tr key={ex.extraction_id || i} style={rowStyle}>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <div>
                                <strong>{ex.form_type || 'Unknown'}</strong>
                                <div style={{ fontSize: '12px', color: getConfidenceColor(ex.form_confidence || 0) }}>
                                  {(ex.form_confidence * 100 || 0).toFixed(0)}% confident
                                </div>
                                {warnings.length > 0 && (
                                  <div style={{ fontSize: '11px', color: '#d32f2f', marginTop: 2 }}>
                                    {warnings.join(', ')}
                                  </div>
                                )}
                              </div>
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <strong>{ex.field_name || 'Unknown'}</strong>
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <div>
                                <strong>{ex.extracted_value}</strong>
                                <div style={{ fontSize: '12px', color: getConfidenceColor(ex.field_confidence || 0) }}>
                                  {(ex.field_confidence * 100 || 0).toFixed(0)}% confident
                                </div>
                              </div>
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <div style={{ fontSize: '12px' }}>
                                <div>Field: {(ex.field_confidence * 100 || 0).toFixed(0)}%</div>
                                <div>Form: {(ex.form_confidence * 100 || 0).toFixed(0)}%</div>
                                {ex.pattern_stats && (
                                  <div style={{ marginTop: 4, padding: 2, background: '#f0f0f0', borderRadius: 3 }}>
                                    <div>Success: {(ex.pattern_stats.success_rate * 100).toFixed(0)}%</div>
                                    <div>False +: {(ex.pattern_stats.false_positive_rate * 100).toFixed(0)}%</div>
                                  </div>
                                )}
                              </div>
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee', fontFamily: 'monospace', fontSize: 11, maxWidth: 200 }}>
                              <div style={{ wordBreak: 'break-all' }}>
                                {ex.pattern || ex.pattern_used || ''}
                              </div>
                              {ex.match_text && (
                                <div style={{ fontSize: '10px', color: '#666', marginTop: 2 }}>
                                  Matched: "{ex.match_text}"
                                </div>
                              )}
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee', maxWidth: 300, minWidth: 200 }}>
                              {highlightMatch(ex.context_text || '', ex.extracted_value)}
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <div style={{ display: 'flex', flexDirection: 'column', gap: 4 }}>
                                <div>
                                  <button 
                                    onClick={() => handleFeedback(ex.extraction_id, true)} 
                                    style={{ background: '#4caf50', color: '#fff', border: 'none', borderRadius: 4, padding: '4px 8px', fontSize: '11px', cursor: 'pointer' }}
                                  >
                                    âœ“ Correct
                                  </button>
                                  <button 
                                    onClick={() => handleFeedback(ex.extraction_id, false)} 
                                    style={{ background: '#f44336', color: '#fff', border: 'none', borderRadius: 4, padding: '4px 8px', fontSize: '11px', cursor: 'pointer', marginLeft: 2 }}
                                  >
                                    âœ— Wrong
                                  </button>
                                </div>
                                <div>
                                  <button 
                                    onClick={() => handleFormTypeFeedback(ex.extraction_id, 'W-2')} 
                                    style={{ background: '#2196f3', color: '#fff', border: 'none', borderRadius: 4, padding: '2px 6px', fontSize: '10px', cursor: 'pointer', marginRight: 2 }}
                                  >
                                    W-2
                                  </button>
                                  <button 
                                    onClick={() => handleFormTypeFeedback(ex.extraction_id, '1099-MISC')} 
                                    style={{ background: '#2196f3', color: '#fff', border: 'none', borderRadius: 4, padding: '2px 6px', fontSize: '10px', cursor: 'pointer', marginRight: 2 }}
                                  >
                                    1099-MISC
                                  </button>
                                  <button 
                                    onClick={() => handleFormTypeFeedback(ex.extraction_id, '1099-NEC')} 
                                    style={{ background: '#2196f3', color: '#fff', border: 'none', borderRadius: 4, padding: '2px 6px', fontSize: '10px', cursor: 'pointer' }}
                                  >
                                    1099-NEC
                                  </button>
                                </div>
                              </div>
                            </td>
                            <td style={{ padding: 8, border: '1px solid #eee' }}>
                              <button 
                                onClick={() => setRegexModal({ open: true, context: ex.context_text || '', pattern: ex.pattern || ex.pattern_used || '' })} 
